window.bookSummaryJSON = "<p><b>High-concept science fiction, deeply human characters, and a weirdly wonderful story drive </b><b><i>The Moons of Barsk,</i></b><b> Lawrence M. Schoen's audiobook sequel to the award-winning </b><b><i>Barsk: The Elephants' Graveyard.</i></b></p> <p>Years after the events of <i>Barsk: The Elephants' Graveyard</i>, the lonely young outcast and physically-challenged Fant, Pizlo, is now a teenager. He still believes he hears voices from the planet’s moons, imparting secret knowledge to him alone. And so embarks on a dangerous voyage to learn the truth behind the messages. His quest will catapult him offworld for the second time is his short life, and reveal things the galaxy isn’t yet ready to know.&nbsp;</p> <p>Elsewhere, Barsk's Senator Jorl, who can speak with the dead, navigates galactic politics as Barsk's unwelcome representative, and digs even deeper into the past than ever before to discover new truths of his own.</p>"; 
